import React, {Component} from 'react';
import './App.css';
import { render } from 'react-dom';

class Title extends Component{
  render(){
    return(
      <header>
        <h1>GoodReader</h1>     
      </header>
    );
  }
}

class App extends Component {
  render(){
  return (
    <div className="App">
      <header className="App-header">
        <Title></Title>        
      </header>

    </div>
  );
  }
}

export default App;
